    state = { isOpen: false };


    handleShowDialog = () => {
        this.setState({ isOpen: !this.state.isOpen });
      };

      render(imgSrc) {
        return (
          <div>
            <img
              className={styles.imgbody}
              src={ImagenesBody.src}
              onClick={this.handleShowDialog}

            />
            {this.state.isOpen && (
              <dialog
                className="dialog"
                style={{ position: "absolute" }}
                open
                onClick={this.handleShowDialog}
              >
                <img
                  className="image"
                  src={ImagenesBody.src}
                  onClick={this.handleShowDialog}

                />
              </dialog>
            )}
          </div>
        );
      }


}
